r($,"atm","a7U",()=>{var q="Quest\xe3o 1",p="Quest\xe3o 2",o="Quest\xe3o 3",n="Quest\xe3o 4",m="Quest\xe3o 5",l=t.q_
return A.a([A.b2("Unidade 1",A.a([A.b2("Aula 1",A.a([A.b2(q,A.a([A.b2("\n1. Os testes, durante um projeto de desenvolvimento de software, s\xe3o fundamentais para garantir a entrega de um produto de qualidade ao cliente, mas eles n\xe3o podem iniciar sem que sejam planejados. Pode-se dizer que o maior prop\xf3sito do planejamento de testes \xe9:\n\n    A. servir de guia para os testadores, mostrando a maneira como os testes devem ser realizados.\n  \n    O planejamento de testes tem v\xe1rios objetivos, como, por exemplo, definir as partes do software que precisam ou n\xe3o ser testadas, mas, o principal objetivo do planejamento de testes \xe9 servir de refer\xeancia e guia ao longo da realiza\xe7\xe3o das atividades de teste.\n    \n    ",B.N)],l)),A.b2(p,A.a([A.b2("\n2. O documento que traz, de maneira detalhada, todos os problemas e erros encontrados, e ainda todos os acontecimentos ocorridos durante a realiza\xe7\xe3o dos testes, focando principalmente naqueles itens que precisar\xe3o ser avaliados posteriormente, segundo a norma IEEE 829, \xe9:\n\n    E. Relat\xf3rio de incidentes de teste.\n\n    O relat\xf3rio de incidentes de teste apresenta, de maneira detalhada e minuciosa, todos os acontecimentos que ocorreram durante as atividades de teste, focando, principalmente, em itens que precisar\xe3o passar por avalia\xe7\xe3o de outros membros da equipe de projeto.\n    \n",B.N)],l)),A.b2(o,A.a([A.b2("\n3. Imagine que voc\xea \xe9 gestor de projeto de desenvolvimento de software, e est\xe1 trabalhando em um grande projeto que cont\xe9m v\xe1rios testadores divididos em equipe. Qual \xe9 o documento que deve ser usado para definir o que ser\xe1 testado, e por quem, de acordo com a norma IEEE 829?\n\n    C. Relat\xf3rio de encaminhamento de itens de teste.\n\n    Caso um grande projeto de desenvolvimento de software precise de mais de uma equipe de testadores, \xe9 poss\xedvel utilizar um relat\xf3rio de encaminhamento de itens de teste para indicar quais integrantes, de qual equipe, ir\xe3o testar determinadas funcionalidades ou partes do software.\n    \n",B.N)],l)),A.b2(n,A.a([A.b2("\n  4. O PMBOK encara a realiza\xe7\xe3o dos testes, por ser uma tarefa extremamente importante para o desenvolvimento de um software, como um projeto independente. Sendo assim, qual \xe9 a \xe1rea de conhecimento do projeto de testes que vai ficar encarregada de definir qual ser\xe1 a abrang\xeancia dos testes, bem como aquilo que dever\xe1 ser testado ou n\xe3o?\n\n      E. Gerenciamento do escopo.\n\n      O gerenciamento do escopo, segundo o PMBOK, serve para definir a extens\xe3o do projeto de testes, definindo o que ser\xe1 ou n\xe3o testado, incluindo os motivos para isso.\n      \n",B.N)],l)),A.b2(m,A.a([A.b2("  \n  5. O PMBOK entende que os testes de software devem formar um projeto independente do projeto de desenvolvimento do software, tendo, inclusive, fases de ciclo de vida que, apesar de poderem ter a mesma nomenclatura, envolvem atividades diferentes. Nesse sentido, segundo o PMBOK, qual \xe9 a fase do projeto de testes que avalia se as atividades est\xe3o sendo realizadas conforme o planejado?\n\n      D. Monitoramento e controle.\n\n      A fase de monitoramento e controle \xe9 respons\xe1vel por indicar se as atividades de teste est\xe3o acontecendo conforme o planejado, para que seja poss\xedvel tomar alguma atitude saneadora antes mesmo que um problema atrapalhe o andamento do projeto de testes e tamb\xe9m do projeto de software.    \n\n",B.N)],l))],l)),A.b2("Aula 2",A.a([A.b2(q,A.a([A.b2("1.O diagrama de caso de uso \xe9 um dos artefatos mais importantes da UML, que descreve as funcionalidades do software de acordo com a vis\xe3o dos seus usu\xe1rios. Nesse sentido, pode-se afirmar que o diagrama de caso de uso define:\n\n    A. a forma de intera\xe7\xe3o dos usu\xe1rios com o software, por meio de suas funcionalidades.\n\n    O diagrama de caso de uso define como os usu\xe1rios interagem com as funcionalidades do software, sem se preocupar com nenhum aspecto ou detalhamento t\xe9cnico do sistema, nem com sua estrutura interna, ou com aspectos do projeto como um todo.\n\n    ",B.N)],l)),A.b2(p,A.a([A.b2(" 2. O diagrama de caso de uso \xe9 um documento que representa, de maneira visual, como se d\xe1 a intera\xe7\xe3o do usu\xe1rio com as funcionalidades do sistema. Geralmente, o diagrama de caso de uso possui quatro pap\xe9is, que representam os elementos envolvidos na funcionalidade. S\xe3o eles:\n\n    B. cen\xe1rio, atores, caso de uso, comunica\xe7\xe3o\n\n    Os nomes dos elementos de um caso de uso s\xe3o: cen\xe1rio, que \xe9 a sequ\xeancia de a\xe7\xf5es realizadas; atores, que s\xe3o os usu\xe1rios ou perfis de usu\xe1rio no sistema; caso de uso, que \xe9 a funcionalidade ou atividade realizada pelo ator; e comunica\xe7\xe3o, que estabelece a conex\xe3o entre o usu\xe1rio e o caso de uso.\n",B.N)],l)),A.b2(o,A.a([A.b2("3.Um caso de teste \xe9 um documento que pretende especificar detalhadamente como ser\xe3o os testes de uma determinada parte espec\xedfica do software. Por meio da realiza\xe7\xe3o de um caso de teste, o testador consegue identificar se os elementos foram constru\xeddos de forma condizente com o pedido inicial. Assinale a alternativa que apresenta esses elementos:\n\n    C. Funcionalidades e requisitos do software\n\n    Por meio da execu\xe7\xe3o dos testes baseados no caso de teste, ser\xe1 poss\xedvel que o testador identifique se os requisitos do software foram implementados conforme o usu\xe1rio havia pedido no in\xedcio do projeto. As demais alternativas se referem a aspectos internos e de projeto.\n    \n",B.N)],l)),A.b2(n,A.a([A.b2("4. O projeto de desenvolvimento de um software passa por v\xe1rias etapas, que podem receber nomenclaturas diferentes nas empresas, mas, geralmente, giram em torno de in\xedcio, planejamento, prepara\xe7\xe3o, especifica\xe7\xe3o, execu\xe7\xe3o e entrega. Os testes, antes de serem realizados, precisam ser planejados a fundo. Em que etapa isso acontece?\n\n    E. Especifica\xe7\xe3o\n\n    Os testes precisam ser planejados em detalhes, antes que sejam realizados. Normalmente, esse planejamento acontece na etapa de especifica\xe7\xe3o do projeto de software. Nas demais fases, os testes s\xe3o realizados.\n      \n",B.N)],l)),A.b2(m,A.a([A.b2("5. O caso de teste \xe9 o documento que, uma vez que sejam realizados os testes baseados nele, ir\xe1 comprovar ou n\xe3o que as funcionalidades e os requisitos do software foram elaborados conforme o que havia sido solicitado no in\xedcio do projeto. Finalizados os testes, um caso de teste pode gerar dois tipos de resultados. Quais s\xe3o eles?\n\n    D. Positivo ou negativo\n\n    Um caso de teste pode ser positivo, quando demonstra que o requisito e a funcionalidade foram desenvolvidos conforme o esperado, e negativo, quando identifica que o requisito e a funcionalidade s\xe3o atendidos somente em parte pelo software que foi desenvolvido.\n\n",B.N)],l))],l)),A.b2("Aula 3",A.a([A.b2(q,A.a([A.b2("",B.N)],l)),A.b2(p,A.a([A.b2("",B.N)],l)),A.b2(o,A.a([A.b2("",B.N)],l)),A.b2(n,A.a([A.b2("",B.N)],l)),A.b2(m,A.a([A.b2("",B.N)],l))],l)),A.b2("Aula 4",A.a([A.b2(q,A.a([A.b2("",B.N)],l)),A.b2(p,A.a([A.b2("",B.N)],l)),A.b2(o,A.a([A.b2("",B.N)],l)),A.b2(n,A.a([A.b2("",B.N)],l)),A.b2(m,A.a([A.b2("",B.N)],l))],l))],l))],l)})
